import { View, StyleSheet } from 'react-native';
import { VideoList } from '../components/Video/VideoList';

export const VideoListScreen = () => {
  return (
    <>
      <View style={styles.container}>
        <VideoList />
      </View>
    </>
  );
};

const styles = StyleSheet.create({
  container: {
    width: '100%',
    padding: 0,
  },
});
